import React from 'react';

function Booking() {
    return (
        <div className='booking'>
            <h2>Create a booking</h2>
            <p>This will be a calendar when implemented</p>
            <p>This will be a dropdown list to select an available time</p>
            <p>This will be a dropdown list to select the style of haircut</p>
            <p>This will display the price of the haircut</p>
            <button>Confirm Booking</button>
        </div>
    );
}

export default Booking;
